import Draggable from "react-draggable";

export default function decoIMG() {
    return(
        <div className="main_body" style={style.main_body} onDoubleClick={handleClick}>
            <Draggable onDrag={(e, data) => trackPos(data)} >
                <div className="box" >
                    <div style={style.box}>이미지 들어갈 자리</div>
                    <p style={style.p}>folder</p>
                </div>
            </Draggable>
        </div>
    )
}

const style = {
    main_body: {
        textAlign:'center',
        width: '120px',
        height: 'auto',
    },
    box: {
        width: '120px',
        height: '120px',
        backgroundColor: "red",
        margin:'0'
    },
    p: {
        margin: '0'
    }
}
